import { useState } from "react";

function Search(props) {
  const [query, setQuery] = useState("");

  const handleInputChange = (event) => {
    const value = event.target.value;
    setQuery(value);

    // Filter the data based on the query
    const filtered = props.data.filter((item) => {
      const isMatched = (
        item.date_collected.toLowerCase().includes(value.toLowerCase()) ||
        item.time_collected.toLowerCase().includes(value.toLowerCase()) ||
        item.pressure_value.toLowerCase().includes(value.toLowerCase()) ||
        item.tech_name.toLowerCase().includes(value.toLowerCase()) ||
        item.job_num.toLowerCase().includes(value.toLowerCase()) ||
        item.serial_num.toLowerCase().includes(value.toLowerCase()) ||
        item.notes.toLowerCase().includes(value.toLowerCase())
      );
      console.log(item, isMatched);
      return isMatched;
    });

    props.handleFilter(filtered);
  };

  const handleReset = () => {
    setQuery("");
    props.handleFilter([]);
  };

  return (
    <div className="search">
      <input
        type="text"
        placeholder="Search..."
        value={query}
        onChange={handleInputChange}
      />
      <button onClick={handleReset}>Reset</button>
    </div>
  );
}

export default Search;











